#include <vector>
#include <utility>  // std::pair, std::make_pair
#include <cstdlib>

using std::vector;
using std::pair;
using std::make_pair;
using std::rand;
using std::srand;

class Solution {
public:
    Solution(vector<int>& nums) {
        copy(nums.begin(), nums.end(), back_inserter(this->nums));

        // 随机初始化伪随机数种子
        srand( time(NULL) );
    }
    
    /** Resets the array to its original configuration and return it. */
    vector<int> reset() {
        // 逆向重复一边所有交换记录
        while (swapHistory.size()) {
            pair<int, int> lastSwap = swapHistory.back();
            swapHistory.pop_back();

            // 将「曾经的交换」再执行一遍
            swap(lastSwap.first, lastSwap.second);
        }

        return nums;
    }
    
    /** Returns a random shuffling of the array. */
    vector<int> shuffle() {
        // 随机交换 size 次两个下标不相同的的数字
        int size = nums.size();
        int idx1;
        int idx2;
        int cnt = 0;
        do {
            idx1 = rand() % size;
            idx2 = idx1 + (rand() % (size - idx1));     // Knuth shuffle算法：参考https://leetcode-cn.com/problems/shuffle-an-array/solution/zhong-gui-zhong-ju-384-da-luan-shu-zu-by-1slm/
            
            if (idx1 != idx2) {
                // 只有随机生成的两个下标不同时才计算一次有效的交换
                cnt ++;
            }
        } while (idx1 == idx2 || cnt < size);
        
        swap(idx1, idx2);

        // 备份交换历史
        swapHistory.push_back(make_pair(idx1, idx2));

        return nums;
    }

private:
    // 记录交换位的历史记录
    vector<pair<int, int>> swapHistory;
    // 记录所有数字
    vector<int> nums;

    void swap(int i, int j) {
        int temp = nums[i];
        nums[i] = nums[j];
        nums[j] = temp;
    }
};

